import React,{Component} from 'react';

import {BrowserRouter, Route, Switch } from 'react-router-dom';
 
import dashboard from './Pages/Dashboard';

export default function  Routes() {
    return (
        <BrowserRouter>
        <Switch>
            <Route path="/dashboard" Component={Dashboard}/>
            
        </Switch>
        </BrowserRouter>
    );
}
